лист непокретности број: 22328 КО Зрењанин I
број парцеле: 9718/2, Ровињска, број дела 1, земљиште под зградом и другим објектом, у површини од 63м2, градско грађевинско земљиште, на коме извршни дужник има право својине у 1/1 дела;
број парцеле: 9718/2, Ровињска 20, број дела 1, породична стамбена зграда, у површини од 63м2, на којој извршни дужник има право својине у 1/1 дела
број парцеле: 9718/2, Ровињска, број дела 2, земљиште уз зграду и други објекат, у површини од 500м2, градско грађевинско земљиште, на коме извршни дужник има право својине у 1/1 дела;
број парцеле: 9718/2, Ровињска, број дела 3, њива 1. класе, у површини од 417м2, градско грађевинско земљиште, на коме извршни дужник има право својине у 1/1 дела.

УТВРЂУЈЕ СЕ да породична стамбена зграда која је уписана на парцели 9718/2 не постоји у природи.

• Породична стамбена зграда број 1 - површине 71 m2, на КП.бр. 2717, број дела 1, у приватној својини са уделом 1/1
• Породична стамбена зграда број 2 - површине 35 m2, на КП.бр. 2717, број дела 2, у приватној својини са уделом 1/1 (напомена: по налазу проценитеља овај објекат је порушен и дата је основна вредност од по 5 евра по квадратном метру у динарској противвредности);
• Помоћна зграда (остава) – неукњижени објекат - површине 36 m2, на КП.бр. 2717, у приватној својини са уделом 1/1 (напомена: по налазу проценитеља овај објекат је неукњижен, који се не одржава и не користи и намена му је помоћна просторија – остава у оквиру домаћинства);
• Земљиште на КП.бр.2717 а које се састоји од:
    ◦ Земљиште под зградом објектом, површине 71 m2, на КП.бр. 2717, број дела 1 – процењене вредности 4.157,54 динара;
    ◦ Земљиште под зградом објектом, површине 35 m2, на КП.бр. 2717, број дела 2 – процењене вредности 2.049,49 динара;
    ◦ Земљиште под зградом објект

Породична стамбена зграда - број објекта 1, површине у габариту 97 м2, у приватној својини са делом поседа 1/1, изграђена на кат.парцели бр. 1441 КО Сурдулица, уписана у Листу непокретности бр. 1176, општина Сурдулица 
     - Кат. парцела бр. 1441 КО Сурдулица, уписана у Листу непокретности бр. 1176, право коришћења са делом поседа од ½ (једне идеалне половине), укупне површине 945 м2, од чега је:

        - земљиште под зградом и другим објектом, површине 97 м2;
        - земљиште под зградом и другим објектом, површине 73 м2;
        - земљиште под зградом и другим објектом, површине 77 м2;
        - земљиште под зградом и другим објектом, површине 34 м2;
        - земљиште под зградом и другим објектом, површине 159 м2;
        - земљиште уз зграду и други објекат, површине 336 м2;
        - њива 2. класе површине 169м2.

2)	Градско грађевинско земљиште укупне површине 484м/2,  бр. парцеле 12004/8,   описана и уписана у Листу непокретности бр. 14211, КО Панчево, удела 1/1 на којој се налази:

3)	Објекат бр. 1: Породична стамбена зграда површине у габариту 199м/2, бр. парцеле 12004/8, у улици Косте Милутиновића бр. 11, Панчево, описана и уписана у Листу непокретности бр. 14211, КО Панчево, обим удела 1/1;

4)	Објекат бр. 2: Помоћна зграда површине 27м/2, бр. парцеле 12004/8, у улици Косте Милутиновића бр. 11, Панчево, објекат изграђен без одобрења за изградњу, описана и уписана у Листу непокретности бр. 14211, КО Панчево, обим удела 1/1;
